function getDegreeElementById(){var e=document.getElementById("port"),t=window.getComputedStyle(e,null),r=t.getPropertyValue("-webkit-transform")||t.getPropertyValue("-moz-transform")||t.getPropertyValue("-ms-transform")||t.getPropertyValue("-o-transform")||t.getPropertyValue("transform");if("none"==r)return 0;console.log(r);var a=r.split("(")[1];a=a.split(")")[0],a=a.split(",");var o=a[0],n=a[1],l=Math.round(Math.asin(n)*(180/Math.PI));return 0>o&&(addDegree=90-Math.round(Math.asin(n)*(180/Math.PI)),l=90+addDegree),0>l&&(l=360+l),l}